<script>
import monitorapi from '@/api/monitor/monitor'
import infoScan from '@/views/project/monitor/infoScan'
import lineScan from '@/views/project/monitor/lineScan'
import $ from 'jquery'
import '@/api/monitor/svgtool'
export default {
  name: 'System',
  components: {
    infoScan,
    lineScan
  },
  // props: {
  //   gngldata: {
  //     type: Object,
  //     required: true,
  //     default() {
  //       return {
  //         'ky_nyzx_dlzf1_kylwg_cyldwd1_ldwd': 0,
  //         'ky_nyzx_dlzf1_kylwg_cyldwd2_ldwd': 0,
  //         'ky_nyzx_dlzf1_kylwg_cyllj1_ljlldw': 0,
  //         'ky_nyzx_dlzf1_kylwg_cyllj1_ljllgw': 0,
  //         'ky_nyzx_dlzf1_kylwg_cyllj1_ssll': 0,
  //         'ky_nyzx_dlzf1_kylwg_cyllj2_ljlldw': 0,
  //         'ky_nyzx_dlzf1_kylwg_cyllj2_ljllgw': 0,
  //         'ky_nyzx_dlzf1_kylwg_cyllj2_ssll': 0,
  //         'ky_nyzx_dlzf1_kylwg_cyyl0101_yxyl': 0,
  //         'ky_nyzx_dlzf1_kylwg_cyyl0102_yxyl': 0,
  //         'ky_nyzx_dlzf1_kylwg_gyldwd1_ldwd': 0,
  //         'ky_nyzx_dlzf1_kylwg_gyldwd2_ldwd': 0,
  //         'ky_nyzx_dlzf1_kylwg_gyllj1_ljlldw': 0,
  //         'ky_nyzx_dlzf1_kylwg_gyllj1_ljllgw': 0,
  //         'ky_nyzx_dlzf1_kylwg_gyllj1_ssll': 0,
  //         'ky_nyzx_dlzf1_kylwg_gyllj2_ljlldw': 0,
  //         'ky_nyzx_dlzf1_kylwg_gyllj2_ljllgw': 0,
  //         'ky_nyzx_dlzf1_kylwg_gyllj2_ssll': 0,
  //         'ky_nyzx_dlzf1_kylwg_gyyl0101_yxyl': 0,
  //         'ky_nyzx_dlzf1_kylwg_gyyl0102_yxyl': 0,
  //         'ky_nyzx_dlzf1_kylwg_yl0101_yxyl': 0
  //       }
  //     }
  //   }
  // },
  data() {
    return {
      infoshow: false,
      code: '',
      linecode: '',
      datas: {}
    }
  },
  mounted() {
    $('svg').svgPanZoom()
    const self = this
    monitorapi.getZhenKongData({
      'regional': 'cj2'
    }).then(res => {
      if (res.state === 1) {
        self.datas = res.data
      }
    }).catch(err => {
      console.log(err)
    })
    $('svg').click(function(e) {
      var linecode = (e.target.parentElement.attributes.id && e.target.parentElement.attributes.id.value) || (e.target.attributes.id && e.target.attributes.id.value)
      self.linecode = linecode
      if (linecode &&
          linecode.indexOf('zk_nyzx') !== -1 &&
          linecode.indexOf('_yxzt') === -1 &&
          linecode.indexOf('_kyjzt') === -1 &&
          linecode.indexOf('_yxsj') === -1) {
        self.$refs.lineScan.dialogTableVisible = true
      }
    })
  },
  methods: {
    showInfo(e) {
      this.code = e.currentTarget.attributes.code.value
      this.$refs.infoScan.dialogTableVisible = true
    },
    showLine(e) {
      this.linecode = e.currentTarget.attributes.code.value
      this.$refs.lineScan.dialogTableVisible = true
    },
    getGuZhang(type) {
      return monitorapi.getGuZhang(type)
    },
    getGuZhangGif(type) {
      return monitorapi.getGuZhangGif(type)
    },
    getGuZhangColor(type) {
      return monitorapi.getGuZhangColor(type)
    },
    getOrigin(id) {
      if (!id) return
      const box = document.getElementById(id + '_1').getBBox()
      const x = box.x + (box.width / 2)
      const y = box.y + (box.height / 2)
      const a = x + 'px' + ' ' + y + 'px'
      return '-webkit-transform-origin:' + a
    },
    getClass() {
      return 'zhuanquan'
    }
  }
}
